import React from 'react'

export default function adminList(props) {
    return (
        <div>
            <tr >
                        <td>{props.adminInfo.full_name}</td>
                        <td>{props.adminInfo.phone}</td>
                        <td>{props.adminInfo.password}</td>
                    </tr>
        </div>
    )
}
